pragma solidity ^0.5.16;

import "./StockStorage.sol";

contract StockInterface  {
    StockStorage stockStorage;
    address stockStorageAddress = 0x4CDB93400db58593Aa348341A6220Cd083858676;
    event Transfer(address indexed _from, address indexed _to, uint _value);
    event Approval(address indexed _owner, address indexed _spender, uint _value);

    constructor() public{
        stockStorage = StockStorage(stockStorageAddress);
    }

    function getName() public view returns (bytes32) {
        return stockStorage.getName();
    }

    function getDecimals() public view returns (uint8) {
        return stockStorage.getDecimals();
    }

    function getStock(address _address) public view returns (bytes32,bytes32) {
        return stockStorage.getStock(_address);
    }

    function setStock(address _addr,bytes32 _name,bytes32 _telno) public returns (bool){
        return stockStorage.setStock(_addr,_name,_telno);
    }

    function getStore(address _address) public view returns (bytes32,uint32) {
        return stockStorage.getStore(_address);
    }

    function setStore(address _addr,bytes32 _name,uint32 _amount) public returns (bool){
        return stockStorage.setStore(_addr,_name,_amount);
    }

}
